Hindsight (2008)  


Verenigde Staten
Thriller
96 minuten

geregisseerd door Paul Holahan
met Leonor Varela, Jeffrey Donovan en Waylon Payne

Onverwacht zwanger met geen middelen om een kind op te voeden, besluiten Dina en Ronnie om hun ongeboren baby op het internet te verkopen. Hun plan begint te ontrafelen, wanneer het stelletje dat ze uitgekozen hebben, Paul en Maria, eigen plannen blijken te hebben.


